import React from "react";
import { Link } from "react-router-dom";
import Navbar from "./Navbar";

const Dashboard = () => {
  return (
    <div>
      <Navbar />
      <h2>Dashboard</h2>
      <Link to="/assignments">View Assignments</Link>
      <Link to="/create-assignment">Create Assignment</Link>
    </div>
  );
};

export default Dashboard;
